import React, { useState } from "react";
import "./Navbar.css";
const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div className="Navbar">
      <span className="nav-logo">AppName</span>
        <a href="/home">Home</a>
        <a href="/about">Thresholding</a>
        <a href="/about">About</a>




    </div>
  );
};

export default Navbar;
